
$(document).ready(function () {

    //drawSimpleMapSmallCells();
    //drawSimpleMap();
    //drawBlankMap();
    drawGameMap();

});

function drawSimpleMapSmallCells() {
    for (var row = 0; row < 40; row++) {
        for (var col = 0; col < 60; col++) {

            HexMapObject.DrawSmallHex(col, row);
        }
    }
}

function drawSimpleMap() {
    for (var row = 0; row < 10; row++) {
        for (var col = 0; col < 15; col++) {

            HexMapObject.DrawHex(col, row);
        }
    }
}

function drawBlankMap() {
    // blank gray map
    for (var row = 0; row < 10; row++) {
        for (var col = 0; col < 15; col++) {

            HexMapObject.RecordLinesForOneHex(col, row);
        }
    }

    var cube2 = HexMapObject.OffsetToCube(5, 5);
    HexMapObject.HighlightRange(cube2.X, cube2.Z, 2, "rgba(255, 0, 0, 0.2)");

    HexMapObject.DrawAllLines("rgba(0, 0, 0, 0.2)");
}

function drawGameMap() {
    for (var row = 0; row < 10; row++) {
        for (var col = 0; col < 15; col++) {
            HexMapObject.PlotTile(col, row, "ocean");
            HexMapObject.RecordLinesForOneHex(col, row);
        }
    }
    
    // plot the islands
    HexMapObject.PlotTile(2, 2, "island");
    HexMapObject.PlotTile(1, 8, "island");
    HexMapObject.PlotTile(13, 2, "island");
    HexMapObject.PlotTile(12, 7, "island");
    HexMapObject.PlotTile(5, 6, "island");
    HexMapObject.PlotTile(7, 1, "island");

    HexMapObject.HighlightRange(5, 5, 2, "rgba(0, 255, 0, 0.2)");

    HexMapObject.PlotShip(5, 5, "battleship", true);
    HexMapObject.PlotShip(2, 3, "battleship", true);

    HexMapObject.PlotShip(13, 3, "battleship", false);
    HexMapObject.PlotShip(14, 3, "battleship", false);

    // hilight each island owned by various factions
    HexMapObject.HighlightRange(2, 2, 0, "rgba(0, 255, 0, 0.2)");
    HexMapObject.HighlightRange(5, 6, 0, "rgba(0, 255, 0, 0.2)");

    HexMapObject.HighlightRange(13, 2, 0, "rgba(255, 0, 0, 0.2)");

    // selected ship
    HexMapObject.HighlightShip(5, 5, "rgba(255, 255, 0, 0.2)");
    
    // draw the grid lines
    HexMapObject.DrawAllLines("rgba(255, 255, 255, 0.5)");
}

var HexMapObject = (function() {
    var lineList = [];

    var offsetToCube = function (col, row) {
        var x = col;
        var z = row - (col - (col & 1)) / 2;
        var y = -x - z;

        return { X: x, Y: y, Z: z };
    };

    var fillHexCell = function (x, z, fillStyle) {
        var center = { X: 60 * x + 100, Y: 35 * x + z * 70 + 100 };

        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");

        var offsets = [
            [40, 0],
            [20, 35],
            [-20, 35],
            [-40, 0],
            [-20, -35],
            [20, -35],
            [20, -35]
        ];

        var start = { X: center.X + 20, Y: center.Y - 35 };
        var end = { X: 0, Y: 0 };

        ctx.fillStyle = fillStyle;
        ctx.beginPath();
        ctx.moveTo(start.X, start.Y);
        for (var i = 0; i < 6; i++) {
            end.X = center.X + offsets[i][0];
            end.Y = center.Y + offsets[i][1];

            ctx.lineTo(end.X, end.Y);
            ctx.lineWidth = 0;

            start.X = end.X;
            start.Y = end.Y;
        }

        ctx.closePath();
        ctx.fill();
    };

    var highlightRange = function(col, row, range, fillStyle) {
        var cube = offsetToCube(col, row);

        for (var dx = -range; dx <= range; dx++) {
            for (var dy = Math.max(-range, -dx - range); dy <= Math.min(range, -dx + range); dy++) {
                var dz = -dx - dy;
                fillHexCell(dx + cube.X, dz + cube.Z, fillStyle);
            }
        }
    };

    var highlightShip = function (col, row, fillStyle) {
        var cube = offsetToCube(col, row);
        var center = { X: 60 * cube.X + 100, Y: 35 * cube.X + cube.Z * 70 + 100 };

        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");

        ctx.fillStyle = fillStyle;
        ctx.lineWidth = 0;
        ctx.beginPath();
        ctx.moveTo(center.X - 25, center.Y - 25);
        ctx.lineTo(center.X + 25, center.Y - 25);
        ctx.lineTo(center.X + 25, center.Y + 25);
        ctx.lineTo(center.X - 25, center.Y + 25);
        ctx.lineTo(center.X - 25, center.Y - 25);
        ctx.closePath();
        ctx.fill();
    };

    var plotShip = function(col, row, shipType, alliedShip) {

        var cube = offsetToCube(col, row);
        var center = { X: 60 * cube.X + 100, Y: 35 * cube.X + cube.Z * 70 + 100 };

        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");

        var img = new Image();

        if (shipType === "battleship") {
            img.src =
                " data:image/png;base64,";
        }

        ctx.drawImage(img, center.X - 40, center.Y - 35);

        if (!alliedShip) {
            highlightShip(col, row, "rgba(128, 128, 128, 0.4)");
        }
    };

    var plotTile = function(col, row, tileGroup) {

        var cube = offsetToCube(col, row);
        var center = { X: 60 * cube.X + 100, Y: 35 * cube.X + cube.Z * 70 + 100 };

        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");

        var img = new Image();

        if (tileGroup === "ocean") {
            switch (4/*Math.floor((Math.random() * 4) + 1)*/) {
            case 1:
                img.src =
                    " data:image/png;base64,";
                break;
            case 2:
                img.src =
                    " data:image/png;base64,";
                break;
            case 3:
                img.src =
                    "data:image/png;base64,";
                break;
            case 4:
                img.src =
                    "data:image/png;base64,";
                break;
            }
        }

        if (tileGroup === "island") {
            //Math.floor((Math.random() * 2) + 1)
            switch (2) {
            case 1:
                img.src =
                    " data:image/png;base64,";
                break;
            case 2:
                img.src =
                    " data:image/png;base64,";
                break;
            }
        }

        ctx.drawImage(img, center.X - 40, center.Y - 35);
    };

    var addToList = function(line) {
        for (var i = 0; i < lineList.length; i++) {
            if (lineList[i].SX === line.SX &&
                lineList[i].SY === line.SY &&
                lineList[i].EX === line.EX &&
                lineList[i].EY === line.EY) {
                return;
            }
            if (lineList[i].EX === line.SX &&
                lineList[i].EY === line.SY &&
                lineList[i].SX === line.EX &&
                lineList[i].SY === line.EY) {
                return;
            }
        }

        lineList = lineList.concat([line]);
    };

    var drawAllLines = function(strokeStyle) {
        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");

        for (var i = 0; i < lineList.length; i++) {
            ctx.beginPath();
            ctx.moveTo(lineList[i].SX, lineList[i].SY);
            ctx.lineTo(lineList[i].EX, lineList[i].EY);
            ctx.lineWidth = 2;
            ctx.lineCap = "round";
            ctx.strokeStyle = strokeStyle;
            ctx.stroke();
        }
    };

    var recordLinesForOneHex = function(col, row) {
        var cube = offsetToCube(col, row);
        var lnX = 60 * cube.X + 100;
        var lnY = 35 * cube.X + cube.Z * 70 + 100;
        var center = { X: lnX, Y: lnY };

        var offsets = [
            [40, 0],
            [20, 35],
            [-20, 35],
            [-40, 0],
            [-20, -35],
            [20, -35],
            [20, -35]
        ];

        var start = { X: center.X + 20, Y: center.Y - 35 };
        var end = { X: 0, Y: 0 };
        for (var i = 0; i < 6; i++) {
            end.X = center.X + offsets[i][0];
            end.Y = center.Y + offsets[i][1];

            var line = { SX: start.X, SY: start.Y, EX: end.X, EY: end.Y };
            addToList(line);

            start.X = end.X;
            start.Y = end.Y;
        }
    };

    var drawHex = function (col, row) {
        var cube = offsetToCube(col, row);
        var center = { X: 60 * cube.X + 100, Y: 35 * cube.X + cube.Z * 70 + 100 };

        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");

        var offsets = [
            [40, 0],
            [20, 35],
            [-20, 35],
            [-40, 0],
            [-20, -35],
            [20, -35],
            [20, -35]
        ];

        var start = { X: center.X + 20, Y: center.Y - 35 };
        var end = { X: 0, Y: 0 };
        for (var i = 0; i < 6; i++) {
            end.X = center.X + offsets[i][0];
            end.Y = center.Y + offsets[i][1];

            ctx.beginPath();
            ctx.moveTo(start.X, start.Y);
            ctx.lineTo(end.X, end.Y);
            ctx.lineWidth = 0.4;
            ctx.lineCap = "round";
            ctx.stroke();

            start.X = end.X;
            start.Y = end.Y;
        }
    };

    var hexCorner = function(center, size, i) {
        var angleDeg = 60.0 * i;
        var angleRad = Math.PI / 180.0 * angleDeg;

        return { X: center.X + size * Math.cos(angleRad), Y: center.Y + size * Math.sin(angleRad) };
    };

    var drawSmallHex = function(col, row) {
        var cube = offsetToCube(col, row);
        var size = 10;
        var width = 2 * size;
        var height = Math.sqrt(3) * size;
        var center = { X: (width*3/4) * cube.X + 100, Y: (height/2) * cube.X + cube.Z * (height) + 100 };

        var c = document.getElementById("battlefieldCanvas");
        var ctx = c.getContext("2d");
        var start = hexCorner(center, size, 0);

        for (var i = 1; i <= 6; i++) {
            var end = hexCorner(center, size, i);

            ctx.beginPath();
            ctx.moveTo(start.X, start.Y);
            ctx.lineTo(end.X, end.Y);
            ctx.lineWidth = 0.4;
            ctx.lineCap = "round";
            ctx.stroke();

            start.X = end.X;
            start.Y = end.Y;
        }
    };

    return {
        LineList: this.linelist,
        RecordLinesForOneHex: recordLinesForOneHex,
        OffsetToCube: offsetToCube,
        DrawHex: drawHex,
        HexCorner: hexCorner,
        DrawAllLines: drawAllLines,
        PlotTile: plotTile,
        HighlightRange: highlightRange,
        PlotShip: plotShip,
        HighlightShip: highlightShip,
        DrawSmallHex: drawSmallHex
    };
})();
